
public class example {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// I want to print 10 stars
		int stars = 0;
		while (stars < 10 ){
			stars++;
			System.out.print("*");
			 
		}
		System.out.println();
		
		for (int star = 0; star < 10; star++)
			System.out.print("X");

	}

}
